import React, {Component} from 'react';
import UserBox from './UserBox';

const UserList = () => {
    let User = [
        {
            "id":"01",
            "nombre":"Nombre1",
            "apellido":"Apellido1",
            "password":"password1",
            "comuna":"comuna1"
        },
        {
            "id":"02",
            "nombre":"Nombre2",
            "apellido":"Apellido2",
            "password":"password2",
            "comuna":"comuna2"   
        }
    ]

    return(
        User.forEach(user => {
            <UserBox id={user.id} nombre={user.nombre} apellido={user.apellido} comuna={user.comuna} />
        })
    )
}

export default UserList;
